import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
        <table>
            <tbody>
                <tr>
                    <td>
                        <img src="gree_icon.svg" alt="icon img" width="50"/>
                    </td>
                    <td>
                        Movie Search
                    </td>
                </tr>
            </tbody>
        </table>
    </div>
  );
}

export default App;
